import React from 'react';
import './footer.css';
import {Container, Row, Col, ListGroup, ListGroupItem} from 'reactstrap';
import {Link} from 'react-router-dom'; 
import logo from '../../assets/images/logo.png';

const quick__links = [
  {
    Path: '/home',
    display: 'Home'
  },
  {
    Path: '/about',
    display: 'About'
  },
  {
    Path: '/tours',
    display: 'Tours'
  },
]

const quick__links2 = [
  {
    Path: '/gallery',
    display: 'Gallery'
  },
  {
    Path: '/login',
    display: 'Login'
  },
  {
    Path: '/register',
    display: 'Register'
  },
]

const Footer = () => {
  return ( <Footer>
    <Container>
      <Row>
        <Col lg='3'>
          <div className="logo">
            <img src={logo} alt="" />
            <p>Explore the best travel adventures with us worldwide.</p>

            <div className="social__links d-flex align-items-cemter gap-"></div>
          </div>
        </Col>
      </Row>
    </Container>
  </Footer>
);
}

export default Footer
